import styles from './PostPreviewItem.module.scss';

const PostPreviewItem = ({post}) => {
  console.log(post)
  return (
    <article className={styles.preview_item}>
      <img alt="Preview picture for article" src={post.previewImage}/>
      <div className={styles.article_wrapper}>
        <h3><a href={"/"+post.slug.current}>{post.title}</a></h3>
        <p></p>
      </div>
      
    </article>  
  )
}

export default PostPreviewItem;
